import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useFieldArray, useForm } from 'react-hook-form';
import styled from 'styled-components';
import axios from 'axios';
// import Tag from '../components/Tag';
import AutoCompleteForArray from '../components/AutoCompleteForArray';
// import KakaoMap from '../components/KakaoMap';
// import KakaoMapAdd from '../components/KakaoMapAdd';
import AddMap from '../components/AddMap';
import useCurrentLocation from '../utils/useCurrentLocation';
import Button from '../components/Button';

enum GenderEnum {
  Female = 'Ïó¨ÏÑ±',
  Male = 'ÎÇ®ÏÑ±',
}

interface IFormInput {
  name: string;
  nickname: string;
  birth: string;
  sex: GenderEnum;
  email: string;
  phone: string;
  password: string;
  passwordRetype?: string;
  memberTags: { tagId: number; tagName: string; emoji: string }[];
  locations: string;
  lat: number;
  lon: number;
  // profile: string;
}

const SignUpContainer = styled.div`
  background-color: var(--gray);
  color: white;
  display: flex;
  flex-direction: column;
  justify-content: center;
  margin-top: 5rem;
  h1 {
    margin-top: 50px;
  }
`;

const SignUpForm = styled.form`
  width: 700px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  font-size: 16px;
  > button:last-child {
    margin-bottom: 50px;
  }

  table {
    margin: 20px 0px;
    border-spacing: 20px 30px;
    tr {
      > td:nth-child(1) {
        white-space: nowrap;
        width: 50px;
      }
      > td:nth-child(2) {
        width: 100%;
        position: relative;
      }
    }
    tr:nth-child(1),
    tr:nth-child(2),
    tr:nth-child(3),
    tr:nth-child(4),
    tr:nth-child(5),
    tr:nth-child(6),
    tr:nth-child(7),
    tr:nth-child(8) {
      input,
      select {
        padding: 5px;
        font-size: 16px;
        width: 100%;
        border: none;
        outline: 1px solid rgb(120, 120, 120);
        background-color: var(--gray);
        color: white;
        &:focus {
          outline: 1px solid rgb(170, 170, 170);
        }
        &::placeholder {
          font-style: italic;
          font-size: 14px;
        }
        &:-webkit-autofill {
          box-shadow: 0 0 0 20px var(--gray) inset;
          -webkit-text-fill-color: white;
          color: white;
        }
      }
    }
    tr:nth-child(2),
    tr:nth-child(5),
    tr:nth-child(6) {
      input {
        width: 370px;
        margin-right: 10px;
      }
    }
  }
  > button:last-child {
    display: flex;
    justify-content: center;
    align-items: center;
  }
`;

const ErrorMessage = styled.span`
  color: red;
  position: absolute;
  top: calc(100% + 5px);
  left: 0;
  font-size: 12px;
`;

const SignUp = () => {
  const {
    register,
    control,
    getValues,
    handleSubmit,
    formState: { errors },
  } = useForm<IFormInput>();
  const { fields, append, remove } = useFieldArray({
    control,
    name: 'memberTags',
    rules: {
      validate: {
        moreThanOneTag: (values) =>
          values.length > 0 ? true : 'ÌÉúÍ∑∏Îäî 1Í∞ú Ïù¥ÏÉÅ ÏÑ†ÌÉùÌï¥Ïïº Ìï©ÎãàÎã§',
      },
    },
  });
  const navigate = useNavigate();
  const { location: currentLocation } = useCurrentLocation();
  const [checkedNickname, setCheckedNickname] = useState(true);
  const [checkedPhone, setCheckedPhone] = useState(true);
  const [checkedEmail, setCheckedEmail] = useState(true);
  const [locationString, setLocationString] = useState('');
  const [lat, setLat] = useState(0);
  const [lon, setLon] = useState(0);

  const onSubmit = (data: IFormInput) => {
    delete data.passwordRetype;
    // console.log(data);
    axios
      .post(`${process.env.REACT_APP_API_URL}/members/signup`, {
        ...data,
        lat,
        lon,
        locations: locationString,
      })
      .then((res) => {
        console.log(res);
        // alert(res);
      })
      .catch((err) => {
        navigate('/login');
        console.log(err);
        alert(err);
        console.log(
          JSON.stringify({
            ...data,
            lat,
            lon,
            locations: locationString,
          }),
        );
      });
  };

  // console.log(watch('tags'));
  // const toggles = watch('tags', []);
  // const [disabled, setDisabled] = useState(false);
  // if (toggles.length > 3) {
  //   alert('ÏµúÎåÄ 3Í∞úÍπåÏßÄ ÏÑ†ÌÉù');
  // }
  // useEffect(() => {
  //   if (toggles.length > 2) {
  //     setDisabled(true);
  //   }
  // }, [toggles]);

  const TAG_DATA = [
    { tagId: 1, tagName: 'Ï∂ïÍµ¨/ÌíãÏÇ¥', emoji: '‚öΩÔ∏è' },
    { tagId: 2, tagName: 'ÎÜçÍµ¨', emoji: 'üèÄ' },
    { tagId: 3, tagName: 'ÏïºÍµ¨', emoji: '‚öæÔ∏è' },
    { tagId: 4, tagName: 'Î∞∞Íµ¨', emoji: 'üèê' },
    { tagId: 5, tagName: 'Î≥µÏã±', emoji: 'ü•ä' },
    { tagId: 6, tagName: 'ÌÉÅÍµ¨', emoji: 'üèì' },
    { tagId: 7, tagName: 'Î∞∞ÎìúÎØºÌÑ¥', emoji: 'üè∏' },
    { tagId: 8, tagName: 'ÌÖåÎãàÏä§/Ïä§ÏøºÏãú', emoji: 'üéæ' },
    { tagId: 9, tagName: 'ÌÉúÍ∂åÎèÑ/Ïú†ÎèÑ', emoji: 'ü•ã' },
    { tagId: 10, tagName: 'Í≤ÄÎèÑ', emoji: '‚öîÔ∏è' },
    { tagId: 11, tagName: 'Î¨¥Ïà†/Ï£ºÏßìÏàò', emoji: 'ü•ã' },
    { tagId: 12, tagName: 'Ï°±Íµ¨', emoji: '‚öΩÔ∏è' },
    { tagId: 13, tagName: 'Îü¨Îãù', emoji: 'üèÉ' },
    { tagId: 14, tagName: 'ÏûêÏ†ÑÍ±∞', emoji: 'üö¥' },
    { tagId: 15, tagName: 'Îì±ÏÇ∞', emoji: 'üèîÔ∏è' },
    { tagId: 16, tagName: 'ÌÅ¥ÎùºÏù¥Î∞ç', emoji: 'üßó‚Äç‚ôÄÔ∏è' },
    { tagId: 17, tagName: 'ÏàòÏòÅ', emoji: 'üèä‚Äç‚ôÄÔ∏è' },
    { tagId: 18, tagName: 'Í≥®ÌîÑ', emoji: '‚õ≥Ô∏è' },
    { tagId: 19, tagName: 'ÏöîÍ∞Ä/ÌïÑÎùºÌÖåÏä§', emoji: 'üßò' },
    { tagId: 20, tagName: 'Ìó¨Ïä§/ÌÅ¨Î°úÏä§Ìïè', emoji: 'üèãÔ∏è' },
    { tagId: 21, tagName: 'Ïä§ÏºÄÏù¥Ìä∏/Ïù∏ÎùºÏù∏', emoji: '‚õ∏Ô∏è' },
  ];

  console.log('render');

  return (
    <SignUpContainer>
      <h1>ÌöåÏõê Í∞ÄÏûÖ</h1>
      <span>ÌöåÏõê Í∞ÄÏûÖ ÌõÑ Îã§ÏñëÌïú Î™®ÏûÑÏóê Ï∞∏Ïó¨Ìï¥Î≥¥ÏÑ∏Ïöî!</span>
      <SignUpForm onSubmit={handleSubmit(onSubmit)}>
        <table>
          <tbody>
            <tr>
              <td>
                <label htmlFor="name">Ïù¥Î¶Ñ</label>
              </td>
              <td>
                <input
                  id="name"
                  {...register('name', { required: 'Ïù¥Î¶ÑÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî' })}
                />
                <ErrorMessage>{errors?.name?.message}</ErrorMessage>
              </td>
            </tr>
            <tr>
              <td>
                <label htmlFor="nickname">ÎãâÎÑ§ÏûÑ</label>
              </td>
              <td>
                <input
                  id="nickname"
                  {...register('nickname', {
                    required: 'ÎãâÎÑ§ÏûÑÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî',
                  })}
                />
                <ErrorMessage>{errors?.nickname?.message}</ErrorMessage>
                <Button
                  value="Ï§ëÎ≥µ ÌôïÏù∏"
                  onClick={() => {
                    const { nickname } = getValues();
                    axios
                      .get(
                        `${process.env.REACT_APP_API_URL}/members/signup/check-nickname/${nickname}`,
                      )
                      .then((res) => {
                        console.log(res);
                        if (res.data === true) {
                          alert('ÏÇ¨Ïö© Î∂àÍ∞ÄÎä•Ìïú ÎãâÎÑ§ÏûÑÏûÖÎãàÎã§.');
                          setCheckedNickname(true);
                        } else {
                          alert('ÏÇ¨Ïö© Í∞ÄÎä•Ìïú ÎãâÎÑ§ÏûÑÏûÖÎãàÎã§.');
                          setCheckedNickname(false);
                        }
                      })
                      .catch((err) => {
                        console.log(err);
                      });
                  }}
                />
              </td>
            </tr>
            <tr>
              <td>
                <label htmlFor="birth">ÏÉùÎÖÑÏõîÏùº</label>
              </td>
              <td>
                <input
                  id="birth"
                  type="date"
                  {...register('birth', { required: 'ÏÉùÎÖÑÏõîÏùºÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî.' })}
                />
                <ErrorMessage>{errors?.birth?.message}</ErrorMessage>
              </td>
            </tr>
            <tr>
              <td>
                <label htmlFor="sex">ÏÑ±Î≥Ñ</label>
              </td>
              <td>
                <select
                  id="sex"
                  {...register('sex', { required: 'ÏÑ±Î≥ÑÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî.' })}
                >
                  <option value="Female">Ïó¨ÏÑ±</option>
                  <option value="Male">ÎÇ®ÏÑ±</option>
                </select>
                <ErrorMessage>{errors?.sex?.message}</ErrorMessage>
              </td>
            </tr>
            <tr>
              <td>
                <label htmlFor="email">Ïù¥Î©îÏùº</label>
              </td>
              <td>
                <input
                  id="email"
                  type="email"
                  {...register('email', { required: 'Ïù¥Î©îÏùºÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî.' })}
                />
                <ErrorMessage>{errors?.email?.message}</ErrorMessage>
                <Button
                  value="Ï§ëÎ≥µ ÌôïÏù∏"
                  onClick={() => {
                    const { email } = getValues();
                    axios
                      .get(
                        `${process.env.REACT_APP_API_URL}/members/signup/check-email/${email}`,
                      )
                      .then((res) => {
                        console.log(res);
                        if (res.data !== true) {
                          alert('ÏÇ¨Ïö© Í∞ÄÎä•Ìïú Ïù¥Î©îÏùºÏûÖÎãàÎã§.');
                          setCheckedEmail(false);
                        } else {
                          alert('ÏÇ¨Ïö© Î∂àÍ∞ÄÎä•Ìïú Ïù¥Î©îÏùºÏûÖÎãàÎã§.');
                          setCheckedEmail(true);
                        }
                      })
                      .catch((err) => {
                        console.log(err);
                      });
                  }}
                />
              </td>
            </tr>
            <tr>
              <td>
                <label htmlFor="phone">Ìú¥ÎåÄÌè∞ Î≤àÌò∏</label>
              </td>
              <td>
                <input
                  id="phone"
                  type="tel"
                  {...register('phone', {
                    required: 'Ìú¥ÎåÄÌè∞ Î≤àÌò∏Î•º ÏûÖÎ†•ÌïòÏÑ∏Ïöî.',
                    pattern: {
                      value: /^(010)-[0-9]{3,4}-[0-9]{4}$/,
                      message: '010-0000-0000 ÌòïÏãùÏóê ÎßûÏ∂∞Ï£ºÏÑ∏Ïöî.',
                    },
                  })}
                />
                <ErrorMessage>{errors?.phone?.message}</ErrorMessage>
                <Button
                  value="Ï§ëÎ≥µ ÌôïÏù∏"
                  onClick={() => {
                    const { phone } = getValues();
                    axios
                      .get(
                        `${process.env.REACT_APP_API_URL}/members/signup/check-phone/${phone}`,
                      )
                      .then((res) => {
                        console.log(res);
                        if (res.data !== true) {
                          alert('ÏÇ¨Ïö© Í∞ÄÎä•Ìïú Î≤àÌò∏ÏûÖÎãàÎã§.');
                          setCheckedPhone(true);
                        } else {
                          alert('ÏÇ¨Ïö© Î∂àÍ∞ÄÎä•Ìïú Î≤àÌò∏ÏûÖÎãàÎã§.');
                          setCheckedPhone(false);
                        }
                      })
                      .catch((err) => {
                        console.log(err);
                      });
                  }}
                />
              </td>
            </tr>
            <tr>
              <td>
                <label htmlFor="password">ÎπÑÎ∞ÄÎ≤àÌò∏</label>
              </td>
              <td>
                <input
                  id="password"
                  type="password"
                  {...register('password', {
                    required: 'ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.',
                    minLength: {
                      value: 8,
                      message: 'ÏµúÏÜå 8Ïûê Ïù¥ÏÉÅÏùò ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.',
                    },
                    maxLength: {
                      value: 16,
                      message: '16Ïûê Ïù¥ÌïòÏùò ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.',
                    },
                    pattern: {
                      value: /^(?=.*\d)(?=.*[a-zA-ZS]).{8,}/,
                      message: 'ÏòÅÎ¨∏, Ïà´ÏûêÎ•º ÌòºÏö©ÌïòÏó¨ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.',
                    },
                  })}
                />
                <ErrorMessage>{errors?.password?.message}</ErrorMessage>
              </td>
            </tr>
            <tr>
              <td>
                <label htmlFor="passwordRetype">ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏</label>
              </td>
              <td>
                <input
                  id="passwordRetype"
                  type="password"
                  {...register('passwordRetype', {
                    required: 'ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÌôïÏù∏Ìï¥Ï£ºÏÑ∏Ïöî.',
                    validate: {
                      matchesPreviousPassword: (value) => {
                        const { password } = getValues();
                        return (
                          password === value || 'ÎπÑÎ∞ÄÎ≤àÌò∏Í∞Ä ÏùºÏπòÌïòÏßÄ ÏïäÏäµÎãàÎã§.'
                        );
                      },
                    },
                  })}
                />
                <ErrorMessage>{errors?.passwordRetype?.message}</ErrorMessage>
              </td>
            </tr>
            <tr>
              <td>
                <p>ÏßÄÏó≠</p>
              </td>
              <td>
                <div>
                  {/* {currentLocation && (
                    <KakaoMapAdd
                      latitude={currentLocation.latitude}
                      longitude={currentLocation.longitude}
                    />
                  )} */}
                  {currentLocation && (
                    <AddMap
                      latitude={currentLocation.latitude}
                      longitude={currentLocation.longitude}
                      locationString={locationString}
                      setLocationString={setLocationString}
                      setLat={setLat}
                      setLon={setLon}
                    />
                  )}
                </div>
              </td>
            </tr>
            <tr>
              <td>
                <p>Í¥ÄÏã¨ ÌÉúÍ∑∏</p>
              </td>
              <td>
                <AutoCompleteForArray
                  fields={fields}
                  append={append}
                  remove={remove}
                  register={register}
                  control={control}
                  data={TAG_DATA}
                  tagLength={3}
                />
              </td>
            </tr>
            {/* <tr>
            <td>
          <label htmlFor="profile">ÌîÑÎ°úÌïÑ ÏÇ¨ÏßÑ</label>
          <td>
          <td>
          <input id="profile" type="file" {...register('profile')} />
          </td>
        </tr> */}
            <Button
              onClick={() => {}}
              value="Í±¥Í∞ïÌïú ÏÇ∂ ÏãúÏûëÌïòÍ∏∞"
              disabled={!checkedNickname && !checkedEmail && !checkedPhone}
              type="submit"
            />
          </tbody>
        </table>
      </SignUpForm>
    </SignUpContainer>
  );
};
export default SignUp;
